#########################################
# K_n embedded in erdos-renyi
#########################################
def erdos_renyi_k(n, p, kn):
    g = nx.Graph()
    g = nx.erdos_renyi_graph(n, p)
    g = nx.convert_node_labels_to_integers(g)
    h = nx.complete_graph(kn)
    h = nx.convert_node_labels_to_integers(h,first_label=(n))
    erdos_edges = g.edges()
    m = g.size()
    g = nx.union(g,h)
    
    for i in xrange(kn):
        e = random.randint(0, m-1)
        v =  erdos_edges[e][random.randint(0, 1)]
        v0 =  erdos_edges[e][0]
        v1 =  erdos_edges[e][1]
        erdos_edges.pop(e)
        m = m-1
        g.remove_edge(v0,v1)
        g.add_edge(v, i+n)
    return g
