#########################################
# Complete K partite 
#########################################
def complete_k_partite(k, setMax, setMin):
    """ """
    if k == 1:
        g = nx.Graph()
    else:
        g = complete_k_partite(k - 1, setMax, setMin)
    setN = random.randint(setMin, setMax)
    print('setN: ', setN)
    n = g.number_of_nodes()
    
    g.add_nodes_from(xrange(n, n+setN))
    if k != 1:
        for i in xrange(n):
            for j in xrange(n, n+setN):
                g.add_edge(i,j)
    return g
