########################################################################
## plot network with divisions
########################################################################
def plot(g, division):
	position = nx.spring_layout(g)
	for i in xrange(len(division)):
	    color = (random.random(), random.random(), random.random())
	    if(len(division[i].nodes()) == 3): # networkx bug fix
	    	for node in division[i].nodes():
	    		nx.draw_networkx_nodes(g, position, nodelist=[node], node_color = color)
	    else:
	    	nx.draw_networkx_nodes(g, position, nodelist=division[i].nodes(), node_color = color)
	nx.draw_networkx_edges(g, position)
	nx.draw_networkx_labels(g, position)
	plt.show()

